import React from 'react';
import {Link} from 'react-router-dom'

class ButtonSignIn extends React.Component {
  state = {
    loginFinal: "",
    passwordFinal: ""
  }
  signIn = event => {
    this.setState ({loginFinal: this.props.login, passwordFinal: this.props.password})
  }
  render () {
    console.log(this.state.loginFinal, this.state.passwordFinal)
    return (
      <div className="buttonLayout" onClick={this.props.signIn}>
        <Link className="linkSignIn" to="/">
          Вход
        </Link>
      </div>
    )
  }
}

export default ButtonSignIn
